import React from "react";


function List(props) {

  return (
    <ul className="list-group">
      {props.groceries.map(item => (
        <li className="list-group-item" key ={item.id} >
          {item.List}
        </li>
      ))}
      Using the map method, render one li element displaying the text property of each grocery
      object.
    </ul>
  );
}

export default List;
